('970adca2-bf79-4b2a-aa09-353f957ec662', 'bf07ca38-24c7-415c-879c-3ab9eba3e4a1', '0c53b3c0-23c2-4491-a5b8-02df42f37250', 'What is the bond order in benzene and how is it calculated?', 'The bond order in benzene is 1.5, calculated as (number of bonding electrons - number of antibonding electrons) / 2.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-11 17:45:03', '2025-11-11 17:45:03', NULL, NULL),
('997cd035-addd-4a55-8a75-c4dff63a4410', '4121d29e-2e90-4d26-8b56-86ed737c3c06', '769989dd-58ec-4b5f-87a4-b43036bbb68b', 'What type of experience does the workshop emphasize for participants?', 'Practical experience through hands-on projects.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-18 13:03:12', '2025-11-18 13:03:12', NULL, NULL),
