('b5382bc3-a864-471a-8133-ce50ad259d67', '7d91fa82-4b8d-4b02-a4fd-76c9eaa08a82', 'd14a639a-37f4-466d-8d94-6c5143042e00', 'What technological solutions exist for growing energy needs?', 'Technological solutions include solar panels, wind turbines, hydropower, biogas, biofuels, and energy-efficient appliances, all aimed at sustainably meeting increasing energy demands.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-11 16:55:53', '2025-11-11 16:55:53', NULL, NULL),
('b6146398-bcb8-40bf-9a3c-17a52fa7918c', '630a223b-e48f-47c3-9b5a-463d48c0fb83', 'cb260d14-31b6-4029-b2c6-addb81456733', 'Describe the types of hypothesis testing errors.', 'Type I Error: Rejecting a true null hypothesis. Type II Error: Failing to reject a false null hypothesis.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-12 09:28:11', '2025-11-12 09:28:11', NULL, NULL),
('b99cc261-b8a3-4d1b-a1b3-11e52a34645a', '4121d29e-2e90-4d26-8b56-86ed737c3c06', '42fe1693-792c-4135-8175-1de00b71f551', 'Explain ambiguity in grammar with an example and why it should be eliminated.', 'Ambiguity occurs when a string can be derived by multiple parse trees (e.g., E  E + E allows different interpretations for \'id + id * id\'). It should be eliminated to ensure clear and consistent parsing behavior.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-11 16:50:55', '2025-11-11 16:50:55', NULL, NULL),
('b9d69cc0-7703-4a7b-9632-6277b7606784', 'bf07ca38-24c7-415c-879c-3ab9eba3e4a1', '81ab9beb-03e5-480d-a43b-7b185f7f223c', 'Differentiate between classical and nonclassical carbocations with examples.', 'Classical carbocations are stable with a positive charge on a carbon directly bonded to three atoms (e.g., tert-butyl cation); nonclassical carbocations have delocalized positive charges, shown in structures like the cyclopropyl cation.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-13 18:33:24', '2025-11-13 18:33:24', NULL, NULL),
