('c3aed01a-e7d6-4e18-9e5a-50c012b120fe', '4121d29e-2e90-4d26-8b56-86ed737c3c06', '42fe1693-792c-4135-8175-1de00b71f551', 'Explain the phases of a compiler with an example using the statement \'Position = initial + rate * 60\'.', 'The phases include lexical analysis (tokenizing the statement), syntax analysis (checking grammar), semantic analysis (validating types), intermediate representation (generating code), code optimization, and code generation. Example tokens are: Position, =, initial, +, rate, *, 60.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-11 16:50:55', '2025-11-11 16:50:55', NULL, NULL),
