('d54920ab-8b66-4dc2-9336-d3e110be8a2f', 'bf07ca38-24c7-415c-879c-3ab9eba3e4a1', '81ab9beb-03e5-480d-a43b-7b185f7f223c', 'What are key features of the nucleophilic attacks in organic reactions?', 'Nucleophilic attacks involve the donation of an electron pair from the nucleophile to an electrophile, significant in determining reaction pathways and regioselectivity.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-13 18:33:24', '2025-11-13 18:33:24', NULL, NULL),
