('dc1feb33-24a3-41ed-a774-2a39cb1f9f7f', 'bf07ca38-24c7-415c-879c-3ab9eba3e4a1', '81ab9beb-03e5-480d-a43b-7b185f7f223c', 'Outline the mechanism of the Perkin reaction.', 'The Perkin reaction involves the formation of a phenoxide ion from an aromatic compound, which then nucleophilically attacks the carbonyl carbon of an anhydride and loses a carboxylate to produce ,-unsaturated carboxylic acids.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-13 18:33:24', '2025-11-13 18:33:24', NULL, NULL),
