('ec680b4c-7fec-4341-9d38-add4767707f1', '7d91fa82-4b8d-4b02-a4fd-76c9eaa08a82', '2cc454d2-1468-419c-8003-eb4238899f57', 'What are the primary causes of deforestation?', 'The main causes include large-scale tree cutting for agriculture, urbanization, and industrialization, leading to loss of wildlife, soil erosion, and climate change.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-11 17:53:03', '2025-11-11 17:53:03', NULL, NULL),
('ef25f80e-7d6a-4751-be09-28de0c44fdd4', '4121d29e-2e90-4d26-8b56-86ed737c3c06', '6f780c32-b61d-48c2-b328-791584eb17cf', 'What does STEM stand for and why is it important in this program?', 'STEM stands for Science, Technology, Engineering, and Mathematics, and it is important because it connects theoretical concepts to real-life applications that can empower youth.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-15 18:19:11', '2025-11-15 18:19:11', NULL, NULL),
('ef54dbaa-d447-4abe-a88b-f961e15ee6ee', 'bf07ca38-24c7-415c-879c-3ab9eba3e4a1', '81ab9beb-03e5-480d-a43b-7b185f7f223c', 'What are the stereochemical outcomes of the hydroxylation of alkenes?', 'Hydroxylation typically results in syn-addition, providing specific stereochemical configurations depending on the structure of the alkene.', 0, 2.50, 1, 0, 0, NULL, 1, '2025-11-13 18:33:24', '2025-11-13 18:33:24', NULL, NULL),
